import React from "react";
import '../../assets/countries.css'

const PlacesHeader = () => {
  return (
    <>
      <header>
        <div classname="places-header">
          <div className="header">
            <nav className="navbar">
              <div className="logo">
                <a title="home" href="\home.html"><img src="img/icon.svg" alt="Icon" /></a>
                <a title="home" href="\home.html">Around The World</a>
              </div>
              <a className="favorites" href="\favorites.html">Favorites</a>
            </nav>
          </div>
        </div>    
      </header>
    </>
  );
}

export default PlacesHeader;
